import React, { Component } from 'react';
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBCollapse, MDBContainer,
MDBHamburgerToggler } from 'mdbreact';
import { BrowserRouter as Router } from 'react-router-dom';
import { Link } from 'react-router-dom';

class NavChuck extends Component {
state = {
  collapse1: false,
  collapseID: ''
}

toggleCollapse = collapseID => () => {
  this.setState(prevState => ({ collapseID: (prevState.collapseID !== collapseID ? collapseID : '') }));
}

toggleSingleCollapse = collapseId => {
  this.setState({
    ...this.state,
    [collapseId]: !this.state[collapseId]
  });
}

render() {
  return (

      <MDBContainer>
        <MDBNavbar style={{ marginTop: '10px' }} >
          <MDBContainer>
            <MDBNavbarBrand>

            </MDBNavbarBrand>
            <MDBHamburgerToggler color="gray" id="hamburger1" onClick={()=> this.toggleSingleCollapse('collapse1')} />
              <MDBCollapse isOpen={this.state.collapse1} navbar>
                <MDBNavbarNav left>
                  <MDBNavItem active>
                  <MDBNavLink to={'/'} className="nav-link" onClick={()=> this.toggleSingleCollapse('collapse1')} > Home </MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                  <MDBNavLink to={'/AboutView'} className="nav-link" onClick={()=> this.toggleSingleCollapse('collapse1')} >About Me</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                  <MDBNavLink to={'/ContactView'} className="nav-link" onClick={()=> this.toggleSingleCollapse('collapse1')}>Contact Me</MDBNavLink>
                  </MDBNavItem>
                </MDBNavbarNav>
              </MDBCollapse>
          </MDBContainer>
        </MDBNavbar>
      </MDBContainer>

    );
  }
}

export default NavChuck;
